import React from "react";
import { useState, useEffect, useContext } from "react";
import Header from "../../header/Header";
import Footer from "../../footer/Footer";
import IndicatesRequired from "../../form/IndicatesRequired";
import MessageRibbon from "../../form/MessageRibbon";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import Input from "../../form/Input";
import styles from "../../form/Form.module.css";
import { AuthContext } from "../../../helpers/AuthContext";

const AddCalendar = () => {
  const navigate = useNavigate();

  const { authState } = useContext(AuthContext);

  const [formData, setFormData] = useState({
    title: "",
    event_date: "",
    start_time: "",
    end_time: "",
    invitees: "",
    reminder_interval: "",
  });

  const [otherUsers, setOtherUsers] = useState([]);

  useEffect(() => {
    axios
      .get(`http://localhost:5000/users/exclude/${authState.id}`)
      .then((response) => {
        setOtherUsers(response.data.users);
      })
      .catch((error) => {
        console.error("Error fetching other users:", error);
      });
  }, []);

  const [errorMessages, setErrorMessages] = useState([]);

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSelectChange = (event) => {
    const selectedOptions = event.target.selectedOptions;
    const selectedUserIds = Array.from(selectedOptions).map((option) =>
      parseInt(option.value)
    );
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    const errors = [];

    const fieldToLablesMap = {
      title: "Title",
      event_date: "Date",
      start_time: "Start Time",
      end_time: "End Time",
      invitees: "Invitees",
      reminder_interval: "Reminder",
    };

    // Validation for required fields
    const requiredFields = [
      "title",
      "event_date",
      "start_time",
      "end_time",
      "invitees",
    ];

    requiredFields.forEach((field) => {
      if (!formData[field]) {
        errors.push(`${fieldToLablesMap[field]} is required.`);
      }
    });

    // Validation for field lengths
    const fieldsToCheckLength = ["title"];
    fieldsToCheckLength.forEach((field) => {
      if (formData[field] && formData[field].length > 50) {
        errors.push(
          `${fieldToLablesMap[field]} must be 50 characters or less.`
        );
      }
    });

    if (errors.length === 0) {
      axios
        .post("http://localhost:5000/login", formData)
        .then((response) => {
          if (!response.data.error) {
            localStorage.setItem("accessToken", response.data.accessToken);

            setErrorMessages([]);
            setFormData({
              email: "",
              password: "",
            });
            navigate("/");
          }
        })
        .catch((error) => {
          errors.push("Invalid email and password combination.");
          setErrorMessages(errors);
          console.error("Error registering user:", error);
        });
    } else {
      setErrorMessages(errors);
    }
  };

  return (
    <div>
      <Header />
      <h1>Add Calendar Event</h1>
      <MessageRibbon messageList={errorMessages} />
      <IndicatesRequired />
      <form onSubmit={handleSubmit} noValidate>
        <div className={styles["form-container"]}>
          <div className={styles["form-sub-container"]}>
            <Input
              label={"Title"}
              type={"text"}
              name={"title"}
              value={formData.title}
              onChange={handleInputChange}
              required={true}
            />
            <Input
              label={"Date"}
              type={"date"}
              name={"event_date"}
              value={formData.event_date}
              onChange={handleInputChange}
              required={true}
            />
            <Input
              label={"Start Time"}
              type={"time"}
              name={"start_time"}
              value={formData.start_time}
              onChange={handleInputChange}
              required={true}
            />
            <Input
              label={"End Time"}
              type={"time"}
              name={"end_time"}
              value={formData.end_time}
              onChange={handleInputChange}
              required={true}
            />
            <Input
              label={"Invitees"}
              type={"select"}
              name={"invitees"}
              value={formData.invitees}
              onChange={handleInputChange}
              required={true}
              size={otherUsers.length}
              selectItems={otherUsers.map(
                (otherUser) => `${otherUser.first_name}`
              )}
              multiple={true}
            />
            <Input
              label={"Reminder"}
              type={"password"}
              name={"password"}
              value={formData.password}
              onChange={handleInputChange}
              required={true}
            />
          </div>
        </div>
        <div className={styles["button-ribbon"]}>
          <button>Login</button>
          <a href="http://localhost:3000/register">Need to register?</a>
        </div>
      </form>
      <Footer />
    </div>
  );
};

export default AddCalendar;
